Eigen::VectorXd DynModel::getFrictionTorque(Eigen::VectorXd dq){
  Eigen::VectorXd A(7);
  A << 0.54615,0.87224,0.64068,1.2794,0.83904,0.30301,0.56489;

  Eigen::VectorXd k(7);
  k << 0,0,0,0,0,0,0;

  Eigen::VectorXd dq_sign(7);
  dq_sign << 0.039533,0.025882,-0.04607,0.036194,0.026226,-0.021047,0.0035526;

  Eigen::VectorXd alpha(7);
  alpha << 5.1181,9.0657,10.136,5.5903,8.3469,17.133,10.336;

  int num_of_joints = dq.size();
  Eigen::VectorXd tau_F(7);
  tau_F = Eigen::VectorXd::Zero(num_of_joints);

  for(int i=0; i < num_of_joints; i++){
        tau_F(i) = -A(i)/(1+exp(-alpha(i)*dq_sign(i))) + A(i)/(1+exp(-alpha(i)*(dq(i)+dq_sign(i))));
  }

  return tau_F;
}

Eigen::VectorXd DynModel::observer(const franka::RobotState& robot_state, Eigen::VectorXd &r, Eigen::VectorXd &integrale_i_1, Eigen::MatrixXd J, double delta_t, Eigen::MatrixXd K, franka::Model& model, int albero, bool grasp){
  Eigen::Map<const Eigen::Matrix<double, 7, 1> > q(robot_state.q.data());
  Eigen::Map<const Eigen::Matrix<double, 7, 1> > dq(robot_state.dq.data());

  Eigen::Map<const Eigen::Matrix<double, 7, 1> > tau(robot_state.tau_J.data());
  Eigen::Map<const Eigen::Matrix<double, 7, 1> > coriolis(model.coriolis(robot_state).data());

  Eigen::VectorXd friction = getFrictionTorque(dq);
  Eigen::VectorXd gravity = getGravityVector(q);
  //std::array<double, 7> gravity_array = model.gravity(robot_state);
  //Eigen::Map<const Eigen::Matrix<double, 7, 1> > gravity(gravity_array.data());
  Eigen::MatrixXd mass = getMassMatrix(q);

  //Eigen::Map<const Eigen::Matrix<double, 7, 1> > gravity(model.gravity(robot_state).data());
  //Eigen::Map<const Eigen::Matrix<double, 7, 7> > mass(model.mass(robot_state).data());
 
  //MOMENTO E DERIVATA DEL MOMENTO
  Eigen::VectorXd p(7);
  Eigen::VectorXd p_dot(7);
  Eigen::VectorXd integrale_i(7);
  Eigen::VectorXd f_ext(7);

  //Fg=J' *(m*[0 0 -9.81 0 0 0])';
  //Forza gripper
  Eigen::MatrixXd R(3,3);
  R(0,0) = robot_state.O_T_EE[0];
  R(0,1) = robot_state.O_T_EE[4];
  R(0,2) = robot_state.O_T_EE[8];
  R(1,0)= robot_state.O_T_EE[1];
  R(1,1)= robot_state.O_T_EE[5];
  R(1,2)= robot_state.O_T_EE[9];
  R(2,0) = robot_state.O_T_EE[2];
  R(2,1) = robot_state.O_T_EE[6];
  R(2,2) = robot_state.O_T_EE[10];


  double m;
  if(albero == -1 && grasp){ //corto
    m = 2.676; // massa del gripper 1.013 massa albero 1.773;// gripper + massa albero in alluminio
  }else if(albero==1 && grasp){ //lungo
    m = 2.912;
  }else {
    m =1.000;
  }
  Eigen::VectorXd mu(3); // coppia dovuta all'albero
  mu << 0,0,0;
  Eigen::VectorXd g_z(6);
  g_z << 0,0,-9.81*m,0,0,0;
  Eigen::VectorXd g_tau(3);
  g_tau=R*mu;
  g_z[3]=g_tau[0];g_z[4]=g_tau[1];g_z[5]=g_tau[2];
  Eigen::VectorXd Fg(7);
  Fg = J.transpose() * ( g_z);
  
  //CALCOLO DEL MOMENTO
  p = mass*dq; 

  //CALCOLO DELLA DERIVATA DEL MOMENTO
  p_dot = gravity - Fg - tau - r; //- coriolis - tau - r; 
  //INTEGRAZIONE DI p_dot
  integrale_i = p_dot*delta_t + integrale_i_1;

  //CALCOLO DEL RESIDUO
  r = K*(integrale_i + p);

  //SALVATAGGIO VALORE DELL'INTEGRALE PER IL PASSO SUCCESSIVO
  integrale_i_1 = integrale_i;
      
  //CALCOLO DELLA TRASPOSTA DELL'INVERSA DELLO JACOBIANO
  Eigen::MatrixXd J_inv = pinv(J);
  Eigen::MatrixXd J_invT = J_inv.transpose();
      
  //CALCOLO DELLE FORZE GENERALIZZATE IN PUNTA A PARTIRE DAL RESIDUO 
  f_ext = (J_invT*r); // forze che l'ambiente esercita sul robot

  return f_ext;
}

Eigen::MatrixXd DynModel::pinv(Eigen::MatrixXd jacobian){
  Eigen::HouseholderQR<Eigen::MatrixXd> qr(jacobian.transpose());
  Eigen::MatrixXd p_inv;
  p_inv.setIdentity(jacobian.cols(), jacobian.rows());
  p_inv = qr.householderQ() * p_inv;
  p_inv = qr.matrixQR().topLeftCorner(jacobian.rows(),jacobian.rows()).triangularView<Eigen::Upper>().transpose().solve<Eigen::OnTheRight>(p_inv);
  //Eigen::MatrixXd temp = jacobian*jacobian.transpose();
  //Eigen::MatrixXd p_inv = jacobian.transpose() * (temp.inverse());
  return p_inv;
}